import {useState} from 'react';

import Header from '../../components/Header';
import TopBanner from '../../components/TopBanner';
import ModalCallingPriceSimulator from '../../components/ModalAddFood';


function handleNext(){

}

function handleTogglePriceSimulatorModal() {
  setNewFoodModalOpen(!isNewFoodModalOpen);
}


const Dashboard = (modalOpen) => {

  const [isNewFoodModalOpen,setNewFoodModalOpen] = useState(false);

    return (
      <>
        <Header/>
        <TopBanner openModal={handleTogglePriceSimulatorModal}/>
        <ModalCallingPriceSimulator
          isOpen={modalOpen}
          setIsOpen={handleTogglePriceSimulatorModal}
          handleNext={handleNext}
        />
      </>
    );
}


export default Dashboard;
